import React from 'react';
import HeroImage from '../assets/HeroImage.jpg'; // Adjust the path if necessary
import './Home.css';

const Home = () => {
  return (
    <div
      className="home"
      style={{
        backgroundImage: `url(${HeroImage})`,
      }}
    >
      <h1>Welcome to Luxury Dress Rental</h1>
      <button className="cta-button">Book A Dress</button>
    </div>
  );
};

export default Home;
